import React from 'react';

const Dashboard = () => (
    <div style={{ padding: '20px' }}>
        <h1>Chào mừng đến Dashboard!</h1>
        <p>Token: {localStorage.getItem('token')}</p>
    </div>
);

export default Dashboard;
